import React from "react";
import "./Table.css";

function Table(props) {
  const tableData = [
    [{ id: "EYFS-Autumn1" }, { id: "EYFS-Autumn2" }, { id: "EYFS-Autumn3" }, { id: "EYFS-Autumn4" }, { id: "EYFS-Autumn5" }, { id: "EYFS-Autumn6" }],
    [{ id: "KSY1-Autumn1" }, { id: "KSY1-Autumn2" }, { id: "KSY1-Autumn3" }, { id: "KSY1-Autumn4" }, { id: "KSY1-Autumn5" }, { id: "KSY1-Autumn6" }],
    [{ id: "KSY2-Autumn1" }, { id: "KSY2-Autumn2" }, { id: "KSY2-Autumn3" }, { id: "KSY2-Autumn4" }, { id: "KSY2-Autumn5" }, { id: "KSY2-Autumn6" }],
    [{ id: "KSY3-Autumn1" }, { id: "KSY3-Autumn2" }, { id: "KSY3-Autumn3" }, { id: "KSY3-Autumn4" }, { id: "KSY3-Autumn5" }, { id: "KSY3-Autumn6" }]
  ];

  return (
    <div>
      <table>
        <thead>
          <tr>
            <th></th>
            <th>Autumn1</th>
            <th>Autumn2</th>
            <th>Autumn3</th>
            <th>Autumn4</th>
            <th>Autumn5</th>
            <th>Autumn6</th>
          </tr>
        </thead>
        <tbody>
          {tableData.map((row, rowIndex) => (
            <tr key={`row-${rowIndex}`}>
              <td>{`KSY${rowIndex + 1}`}</td>
              {row.map((cell, cellIndex) => (
                <td
                  key={`cell-${cellIndex}`}
                  id={cell.id}
                  onDrop={props.onDrop}
                  onDragOver={props.onDragOver}
                ></td>
              ))}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default Table;
